// Create FAQ drawers plugin
(function( $ ){

	$.fn.TOC = function() {
		//create the div to hold the TOC
		this.before('<div id="toc"><ul></ul></div>');
		var toc = $('#toc ul');

		//loop through the question headers
		this.find('h5').attr("id", function(i) {
			//create unique IDs to anchor
			return "anchor" + i;
		}).each(function() {
			//create a link to each anchor
			var question = $(this).html();
			var link = $(this).attr('id');
			toc.append('<li><a href="#' + link + '">' + question + '</a></li>');
		});
	};

	$.fn.calculator = function() {
		var total = 0;
		var instances = 0;
		var RAM = 0;
		var totalRAM = 0;
		count = 0;

		this.find('tbody').find('tr').each(function() {
			instances = parseInt($(this).find('span.instance.count').text());
			RAM = parseInt($(this).find('span.RAM.count').text());
			totalRAM = totalRAM + (instances*RAM);
		});

		total = parseFloat(totalRAM*4.32/32).toFixed(2);
		$('.calc-total').text('$' + total);
		$('.calc-RAM').text(totalRAM + 'MB');
	};

	$.fn.link = function(loc) {
		this.live("click", function(){
			window.location = loc;
		});
	};

})( jQuery );

function hash2modal(){
    var hash = document.location.hash;

    if(hash == "") {
        return;
    }

    var route = hash.split('#!/')[1];

    if(route == "signup") {
        $('#myModal').modal('show');
    }
    else if (route == "login") {
        $('#Login').modal('show');
    }
}

