    var registerCsrfToken = function () {
        var target = $('form');
        target.ready(function () {
            var activeToken,
                holdHandler;
            holdHandler = function () {
                alert('Form is loading, please try again in 2 seconds.');
                return false;
            };
            target.submit(holdHandler);
            setInterval(function (){
                // Monitoring the cookie for changes...
                // Only way to make sure we'll have the last token
                var token = $.cookie('csrftoken');
                if (token === activeToken) {
                    return;
                }
                activeToken = token;
                target.unbind('submit', holdHandler);
                $('form input[name=csrfmiddlewaretoken]').attr('value', token);
            }, 500);
            // Trigger a request on the action URL to get a CSRF token set in the cookie
            $.ajax({
                url: target.attr('action'),
                type: 'GET'
            });
        });
    };

    var loggedInMenu = function () {
        var logged = ($.cookie('_loggedFlag') == 1);

        var flipMenu = function () {
            if (logged === false) {
                $('.loggedin').hide();
                $('.loggedout').show();
                return;
            }
            $('.loggedin').show();
            $('.loggedout').hide();
            //if logged in, display the outage alert element
			$('#outage-alert').slideDown();
        };

        flipMenu();

        $('#padlock').ready(function () {
            $.ajax({
                url: '/oauth2/authorize',
                type: 'GET',
                complete: function (jqXHR, textStatus) {
                    //FIXME: Uggly hack :-(
                    logged = (jqXHR.responseText.indexOf('<h1>Missing Redirect URI</h1>') >= 0);
                    $.cookie('_loggedFlag', (logged ? 1 : 0));
                    flipMenu();
                }
            });
        });
    };

