	var displayStatus = function (target) {
	    target = $(target);
	    $.ajax({
	        url: 'https://status.dotcloud.com/api/1/status',
	        dataType: 'json'
	    }).complete(function(data, textStatus) {
	        if (textStatus !== 'success') {
	            return;
	        }
	        var currentStatus = JSON.parse(data.responseText);
	        $.each(	currentStatus.recent_statuses, function(i, item) {
	            var status = item.status;
	            var localDate = localTime(Date.parse(item.create_date));
	            var date = moment(localDate).fromNow();
				var dateUTC = moment(item.create_date).format('MMM Do YYYY, h:mm a');

	            var color = "up";
	            if (status=="warning") {
	                color = "warning";
	            } else if (status=="down") {
	                color="down";
	            } 

	            $('#status').append(
	                '<li><div><span class="status ' 
	                    + color  + '"/>' + '<b>' +item.status + '</b>'  + '<span class="date"> ' + date + ',  ' +  dateUTC + '  UTC </span></div>' 
	                    + '<p class="message">' + item.message + '</p></li>'
	            )
	        });
	    });

	};

	var localTime = function(date) {
		//get the user's timezone offset in milliseconds from epoch
		var currentDate = new Date();
        var offset = currentDate.getTimezoneOffset()*1000*60;

		//apply offset
		date = date - offset;
		return date;
	}
